import React from 'react';
import './index.css';
import { Column } from '@ant-design/charts';

const DemoColumn: React.FC = () => {
    var data = [
      {
        date: '21-5-30',
        value: 82,
      },
      {
        date: '21-5-31',
        value: 74,
      },
      {
        date: '21-6-1',
        value: 70,
      },
      {
        date: '21-6-2',
        value: 78,
      },
      {
        date: '21-6-3',
        value: 88,
      },
      {
        date: '21-6-4',
        value: 90,
      },
      {
        date: '21-6-5',
        value: 83,
      },
      {
        date: '21-6-6',
        value: 70,
      },
      {
        date: '21-6-7',
        value: 89,
      },
      {
        date: '21-6-8',
        value: 96,
      },
    ];
    var config = {
      data: data,
      xField: 'date',
      yField: 'value',
      label: {
        position: 'middle',
        style: {
          fill: '#ffffff',
          opacity: 0.7
        },
      },
      meta: {
        date: { alias: 'date' },
        value: { min: 0, max: 100 },
      },
      tooltip: false,
      annotations: [
        {
          type: 'line',
          start: ['min', 'mean'],
          end: ['max', 'mean'],
          text: {
            content: '平均值',
            offsetY: -2,
            style: {
              textAlign: 'left',
              fontSize: 10,
              fill: 'red',
              textBaseline: 'bottom',
            },
          },
          style: { stroke: 'red' },
          offsetY: -108
        },
      ],
    };
    return <Column {...config} />;
  };

class MyBar extends React.Component {
    constructor(props){
        super(props);
        this.title=["近期設備稼動率分析","近期設備用時分析"];
    }
    render() {
        return (
        <div id="bar">
            <div>
                <div>{this.title[0]}</div>
                <div><DemoColumn /></div>
            </div>
            <div>
                <div>{this.title[1]}</div>
                <div></div>
            </div>
        </div>
        );
    }
}
export default MyBar
